#include <iostream>#include <stack>int main() {    int n;    std::cin >> n;    std::stack<int> cd;    std::stack<int> cb;    for (int i = 0; i < n; ++i) {        int temp;        std::cin >> temp;        cd.push(temp);    }    while (!cd.empty()) {        int t = cd.top();        cd.pop();        if (!cd.empty()) {            if (cd.top() == t) {                cd.pop();                continue;            }        }        if (cb.empty()) {            cb.push(t);            continue;        }        if (t == cb.top()) {            cb.pop();            continue;        } else {            cb.push(t);        }    }    if (cb.empty()) {        std::cout << "NULL";    } else {        while (!cb.empty()) {            std::cout << cb.top() << " ";            cb.pop();        }    }    return 0;}